INSERT INTO `artist` (`id`, `birth_date`, `death_date`) VALUES ('1', '1881', '1973', '1');
INSERT INTO `artist_info` (`id`, `description`, `lang_code`, `name`, `artist_id`) VALUES (NULL, 'Hiszpański malarz, rzeźbiarz, grafik oraz ceramik, uznawany za jednego z najwybitniejszych artystów XX wieku. On i Georges Braque są twórcami nurtu malarstwa zwanego kubizmem. ', 'PL', 'Pablo Picasso', '1');
INSERT INTO `artist_info` (`id`, `description`, `lang_code`, `name`, `artist_id`) VALUES (NULL, 'Spanish painter, sculptor, printmaker, ceramicist, stage designer, poet and playwright who spent most of his adult life in France.', 'EN', 'Pablo Picasso', '1'); 
