INSERT INTO `artwork_info` (`id`, `description`, `lang_code`, `title`, `artwork_id`) VALUES (NULL, 'Pablo Picasso namalował „Guernicę” w 1937 roku na wieść o zbombardowaniu Guerniki – świętego miasta Basków – w czasie hiszpańskiej wojny domowej.', 'PL', 'Guernica', '1');
INSERT INTO `artwork_info` (`id`, `description`, `lang_code`, `title`, `artwork_id`) VALUES (NULL, 'Probably Picasso\'s most famous work, Guernica is certainly the his most powerful political statement, painted as an immediate reaction to the Nazi\'s devastating casual bombing practice on the Basque town of Guernica during Spanish Civil War.', 'EN', 'Guernica', '1');
INSERT INTO `artwork` (`id`, `cretion_year`, `photo`, `artist_id`, `maintenance_date`, `employee_id`) VALUES ('2', '1903', , '1', '01.02.2019', '1', '1');
INSERT INTO `artwork_info` (`id`, `description`, `lang_code`, `title`, `artwork_id`) VALUES (NULL, 'Autorem tego obrazu jest wybitny malarz Pablo Picasso. Został on namalowany w błękitnym okresie twórczości autora. Głównym elementem, który na to wskazuje, jest sama kolorystyka obrazu - niebieski koloryt. Do tego kolejna cecha charakterystyczna, jaką jest wydłużenie proporcji przedstawianej postaci.', 'PL', 'Stary Gitarzysta', '2');
INSERT INTO `artwork_info` (`id`, `description`, `lang_code`, `title`, `artwork_id`) VALUES (NULL, 'The Old Guitarist is an oil painting by Pablo Picasso created late 1903 - early 1904. It depicts an old, blind, haggard man with threadbare clothing weakly hunched over his guitar, playing in the streets of Barcelona, Spain. It is currently on display at the Art Institute of Chicago as part of the Helen Birch Bartlett Memorial Collection. ', 'EN', 'The Old Guitarist', '2');
INSERT INTO `artist` (`id`, `birth_date`, `death_date`) VALUES ('2', '1838', '1893', '1');
INSERT INTO `artist_info` (`id`, `description`, `lang_code`, `name`, `artist_id`) VALUES (NULL, 'Polski malarz, twórca obrazów historycznych i batalistycznych, historiozof. Był autorem ponad trzystu obrazów olejnych oraz kilkuset rysunków i szkiców.', 'PL', 'Jan Matejko', '2');
INSERT INTO `artist_info` (`id`, `description`, `lang_code`, `name`, `artist_id`) VALUES (NULL, 'Polish painter known for paintings of notable historical Polish political and military events.', 'EN', 'Jan Matejko', '2');
INSERT INTO `artwork` (`id`, `cretion_year`, `photo`, `artist_id`, `maintenance_date`, `employee_id`) VALUES ('3', '1862', , '2', '01.01.2019', '1', '1');
INSERT INTO `artwork_info` (`id`, `description`, `lang_code`, `title`, `artwork_id`) VALUES (NULL, 'Pełny tytuł obrazu znanego powszechnie jako „Stańczyk” brzmi: „Stańczyk w czasie balu na dworze królowej Bony wobec straconego Smoleńska”. Dzieło to powstało w roku 1862 i przyniosło autorowi olbrzymie poważanie oraz otwarło przed nim drzwi do malarskiej kariery.', 'PL', 'Stańczyk', '3');
INSERT INTO `artwork_info` (`id`, `description`, `lang_code`, `title`, `artwork_id`) VALUES (NULL, 'Stanczyk, or to give its full title, Stanczyk during a Ball at the Court of Queen Bona after the Loss of Smolensk is an iconic Polish painting from the late-nineteenth century painter Jan Matejko.', 'EN', 'Stanczyk', '3');
